import React from 'react';

function Food({fav, img}) {
  return <div>
  <h1> hi {fav}</h1>;
  </div>
}

const foodILike = [
  {
    name : "two um ba",
    image : "https://external-content.duckduckgo.com/iu/?u=https%3A%2F%2Ftse1.mm.bing.net%2Fth%3Fid%3DOIP.msSbiQCx2D1UTRJFpumouwHaD9%26pid%3DApi&f=1"
  },
  {
    name : "samgyupsal",
    image : "https://external-content.duckduckgo.com/iu/?u=https%3A%2F%2Ftse1.mm.bing.net%2Fth%3Fid%3DOIP.msSbiQCx2D1UTRJFpumouwHaD9%26pid%3DApi&f=1"
  },
]

function App() {
  return (
    <div className="App">
      <h1>hellossds</h1>
      {foodILike.map(dish => <Food fav={dish.name} img={dish.image} /> 
      )}
    </div>
  );
}

export default App;
